css:
atom-text-editor,
:host {
  background: #181818;
  background: url(https://cloud.githubusercontent.com/assets/9166224/12528332/173d2b48-c158-11e5-99a9-9946b0168a99.jpg);
  background-size: cover;
  color: #c5c8c6;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #373b41;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  opacity: .05;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #242424;
  color: white;
  font-weigth: bold;
  margin-right: 10px;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #7ac822;
  color: #ffffff;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #ffffff;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #2c9958;
}
atom-text-editor .invisible,
:host .invisible {
  color: #c5c8c6;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #2c9958;
  color: black;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #969896;
  background-color: #131313;
  font-size: 12px;
  padding: 2px 10px 2px 10px;
}
.keyword {
  color: #e8bd03;
}
.keyword.control {
  color: white;
}
.keyword.operator {
  color: #7ddb13;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #339e18;
}
.storage {
  display: inline-block;
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
  border: none;
  color: #b8dd3f;
  text-decoration: normal;
  text-align: center;
  text-shadow: 0 0 10px #ffffff, 0 0 20px #ffffff, 0 0 30px #ffffff, 0 0 40px #7ac822, 0 0 70px #7ac822, 0 0 80px #7ac822, 0 0 100px #7ac822;
  -webkit-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  -moz-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  -o-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
}
/* close bracket */
.bracket-matcher {
  border-bottom: 1px solid #7ddb13;
  position: absolute;
  color: black;
}
.constant {
  color: #e8bd03;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #e8bd03;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.variable {
  color: white;
}
.variable.interpolation {
  color: #ec9796;
}
.variable.parameter.function {
  display: inline-block;
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
  border: none;
  color: #b8dd3f;
  text-decoration: normal;
  text-align: center;
  text-shadow: 0 0 10px #ffffff, 0 0 20px #ffffff, 0 0 30px #ffffff, 0 0 40px #7ac822, 0 0 70px #7ac822, 0 0 80px #7ac822, 0 0 100px #7ac822;
  -webkit-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  -moz-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  -o-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
}
.invalid.illegal {
  background-color: #f4c2c1;
  color: #1d1f21;
}
.string {
  color: #b5bd68;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #f4c2c1;
}
.punctuation.definition.comment {
  color: #7ddb13;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #c5c8c6;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #257211;
}
.support.class {
  color: #339e18;
}
.support.function {
  color: #7ac822;
}
.support.function.any-method {
  color: #81a2be;
}
/* values of css */
.constant.property-value.css {
  color: #7ddb13;
}
.constant.other.rgb-value.css {
  color: #e8bd03;
  background-color: #242424;
  border: 1px solid #4b4b4b;
  padding: 2px;
}
.entity {
  display: inline-block;
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
  text-decoration: none;
  color: #b8dd3f;
  text-shadow: 0 0 5px #ffffff, 0 0 20px #ffffff, 0 0 30px #ffffff, 0 0 40px #7ac822, 0 0 70px #7ac822, 0 0 80px #7ac822, 0 0 100px #7ac822;
  -webkit-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  -moz-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  -o-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
}
.entity.name.function {
  color: #7ac822;
}
.entity.name.type {
  color: #339e18;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #b5bd68;
}
.entity.name.class,
.entity.name.type.class {
  color: #339e18;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #f4c2c1;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #7ddb13;
}
.entity.other.attribute-name.id {
  color: #81a2be;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #339e18;
}
.meta.separator {
  background-color: #373b41;
  color: #c5c8c6;
}
.none {
  color: #c5c8c6;
}
.markup.bold {
  color: #de935f;
  font-weight: bold;
}
.markup.changed {
  color: #e8bd03;
}
.markup.deleted {
  color: #f4c2c1;
}
.markup.italic {
  color: #e8bd03;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #f4c2c1;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.entity.name.tag {
  text-decoration: none;
}
/* html */
.entity.name.tag.structure.any.html {
  color: white;
}
/* script */
.entity.name.tag.script.html {
  color: #7ddb13;
}
/* li */
.entity.name.tag.html {
  color: white;
}
.entity.other.attribute-name.id.html {
  color: white;
}
/* less */
.variable.other.less {
  color: white;
  text-shadow: 0 0 5px #ffffff, 0 0 20px #ffffff, 0 0 30px #ffffff, 0 0 40px #7ac822, 0 0 70px #7ac822, 0 0 80px #7ac822, 0 0 100px #7ac822;
  -webkit-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  -moz-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  -o-transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
  transition: all 200ms cubic-bezier(0.42, 0, 0.58, 1);
}
